description.text:
Nella  mia ricerca di proteggere ogni cavo della mia stampante era ormai rimasto fuori solo più il  retro dell'LCD di comando... LCD giù &quot;addizionato&quot; del doppio deviatore per comandare i led posizionato intorno all'estrusore e nel retro dell'MK8 ad illuminare l'area di cambio filo.<br />
Con questo LCD Box completo il lavoro... grazie ad una prolunga per la SD &quot;strategicamente&quot; piazzata (acquistata da aliexpress, se guardate la foto capite immediatemante come trovarla) ed a una micro modifica del firmware per &quot;comandare&quot; il cambio SD anche in assenza di contatto, ora non ci sono più cavi non protetti in tutta la mia stampante, che così può trovare la sua corretta collocazione in qualsiasi scrivania senza temere che l'ardita spolveratrice folle artigli un contatto rendendo la stampante poco più di un soprammobile!
PS: se mettete la mia stessa prolunga per la SD per comandare il cambio scheda dovete modificare il file ultralcd.cpp scommentando e/o ripristinando l'invio del comando M21, io ho fatto così:
<code >if (card.cardOK) 
{
  if (card.isFileOpen()) 
  {
    if (card.sdprinting)
    {
      MENU_ITEM(function, MSG_PAUSE_PRINT, lcd_sdcard_pause);
    }
    else
    {
      MENU_ITEM(function, MSG_RESUME_PRINT, lcd_sdcard_resume);
    }
    MENU_ITEM(function, MSG_STOP_PRINT, lcd_sdcard_stop);
  }
  else 
  {
    MENU_ITEM(submenu, MSG_CARD_MENU, lcd_sdcard_menu);
    // MENU_ITEM(submenu, MSG_CARD_ANALIZER, lcd_sdcard_analizer);
    // #if SDCARDDETECT &lt; 1
      MENU_ITEM(gcode, MSG_CNG_SDCARD, PSTR("M22"));  // SD-card changed by user
    // #endif
  }
}
else 
{
  MENU_ITEM(submenu, MSG_NO_CARD, lcd_sdcard_menu);
  // #if SDCARDDETECT &lt; 1
    MENU_ITEM(gcode, MSG_INIT_SDCARD, PSTR("M21")); // Manually initialize the SD-card via user interface
  // #endif
}</code>
